<!DOCTYPE html>
<html lang="en">
    
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
    <title>Document</title>
    <style>
        @import  url('https://fonts.googleapis.com/css2?family=Kufam:wght@400;500;600&display=swap');

        * {
            -webkit-print-color-adjust: exact !important;
            /* Chrome, Safari, Edge */
            color-adjust: exact !important;
            /*Firefox*/
        }

        body {
            position: relative;
            padding-top: 50px;
            font-family: 'Kufam', sans-serif !important;

        }

        .card {
            width: 80%;
            margin-left: auto;
            margin-right: auto;
            display: block;
            padding: 20px;
            border-radius: 20px;
            text-align: center
        }

        .front {
            width: 300px;
            height: 525px;
            display: inline-block;
            border-radius: 15px;
            margin-left: 4%;
            margin-right: 4%;
            padding: 20px;
            /* background-image: url('http://localhost/site/imgs/card/front.png'); */
            background-image: url("data:image/png;base64, ");
            background-size: cover;
            background-position: center center;
            background-repeat: no-repeat;
            clear: both;
            border: 1px solid #ccc;
            overflow: hidden;
        }

        .back {
            width: 300px;
            overflow: hidden;
            height: 525px;
            display: inline-block;
            border-radius: 15px;
            margin-left: 4%;
            margin-right: 4%;
            padding: 20px;
            /* background-image: url('http://localhost/site/imgs/card/back.png'); */
            background-image: url("data:image/png;base64, ");
            background-size: cover;
            background-position: center center;
            background-repeat: no-repeat;
            clear: both;
            border: 1px solid #ccc;


        }

        img.person {
            height: 146px;
            width: 116px;
            border-radius: 10px;
            margin-top: 125px;
            margin-bottom: 15px;
            object-fit: cover;
        }

        h2 {
            font-size: 18px;
            margin-top: 0px;
            margin-bottom: 15px;
            color: #533F37;
        }

        h2.en {
            margin-bottom: 30px
        }

        h3 {
            font-size: 14px;
            font-weight: 400;
            text-align: right;
            margin-right: 35px
        }

        span {
            margin-right: 60px
        }

        h3 i {
            font-style: normal;
            min-width: 70px;
            display: inline-block;
            float: right;
        }

        @media  only screen and (max-width : 776px) {
            body {
                overflow-x: hidden;
            }

            .front,
            .back {
                margin-top: 25px;
                margin-bottom: 25px;
                margin-right: auto;
                margin-left: auto;
                display: block;
                width: 100%
            }

        }

     

    </style>


</head>

<body style="font-family: 'dejavu sans', sans-serif;">

    <section>
        <div class="card">
            <div class="front">
                
                <img src="data:image/png;base64," class="person" alt="">
                
                
                <h2>Eugenia Maxwell</h2>
                <h2 class="en">Desiree Marshall</h2>
                <h3> <i>نوع العضوية</i> <span> الانتساب</span></h3>
                <h3> <i>رقم الهوية</i> <span>546 </span></h3>
                <h3> <i>رقم العضوية</i> <span> 3</span></h3>
                <h3> <i>تاريخ الانتهاء</i> <span> 2023-06-13</span></h3>



            </div>
            <div class="back">
            </div>
        </div>
    </section>
</body>

</html>
